import React, { useState, useEffect } from 'react';
import { vitalsAPI } from '../../api/endpoints';

const ReadOnlyConsultationView = ({ consultation, onClose }) => {
  const [vitals, setVitals] = useState(null);

  useEffect(() => {
    fetchVitals();
  }, []);

  const fetchVitals = async () => {
    try {
      const response = await vitalsAPI.getLatestVitals(consultation.patient_id);
      setVitals(response.data);
    } catch (error) {
      console.error('Error fetching vitals:', error);
    }
  };

  const parseSymptoms = (symptoms) => {
    // Parse the symptoms string to extract eye examination data
    const rightEyeMatch = symptoms.match(/Right Eye: VA ([^,]*), Cornea ([^.]*)/);
    const leftEyeMatch = symptoms.match(/Left Eye: VA ([^,]*), Cornea ([^.]*)/);

    return {
      rightEye: {
        visualAcuity: rightEyeMatch ? rightEyeMatch[1] : 'Not recorded',
        cornea: rightEyeMatch ? rightEyeMatch[2] : 'Not recorded'
      },
      leftEye: {
        visualAcuity: leftEyeMatch ? leftEyeMatch[1] : 'Not recorded',
        cornea: leftEyeMatch ? leftEyeMatch[2] : 'Not recorded'
      }
    };
  };

  const eyeData = parseSymptoms(consultation.symptoms || '');

  return (
    <div style={{
      position: 'fixed',
      top: 0,
      left: 0,
      right: 0,
      bottom: 0,
      background: 'rgba(0, 0, 0, 0.8)',
      display: 'flex',
      alignItems: 'center',
      justifyContent: 'center',
      zIndex: 1000,
      padding: '20px'
    }}>
      <div style={{
        background: '#1e1e2f',
        borderRadius: '12px',
        width: '90%',
        maxWidth: '800px',
        maxHeight: '90vh',
        overflow: 'auto',
        border: '1px solid #2a2d47'
      }}>
        <div style={{
          display: 'flex',
          justifyContent: 'space-between',
          alignItems: 'center',
          padding: '20px',
          borderBottom: '1px solid #2a2d47',
          background: '#2a2d47',
          borderRadius: '12px 12px 0 0'
        }}>
          <h3 style={{margin: 0, color: '#ffffff', fontSize: '18px'}}>
            üëÅ Eye Examination - {new Date(consultation.created_at).toLocaleDateString()}
          </h3>
          <button 
            onClick={onClose}
            style={{
              background: 'none',
              border: 'none',
              fontSize: '24px',
              cursor: 'pointer',
              color: '#ffa057',
              padding: '0',
              width: '30px',
              height: '30px',
              display: 'flex',
              alignItems: 'center',
              justifyContent: 'center',
              borderRadius: '50%'
            }}
          >
            √ó
          </button>
        </div>

        <div style={{padding: '20px'}}>
          {/* Vital Signs Section */}
          {vitals && (
            <div style={{
              background: '#2a2d47',
              borderRadius: '8px',
              padding: '16px',
              marginBottom: '20px',
              border: '1px solid #3a3d5a'
            }}>
              <h4 style={{color: '#ffa057', margin: '0 0 12px 0'}}>Vital Signs</h4>
              <div style={{display: 'grid', gridTemplateColumns: 'repeat(auto-fit, minmax(150px, 1fr))', gap: '12px'}}>
                <div>
                  <label style={{color: '#b8bcc8', fontSize: '12px'}}>Blood Pressure</label>
                  <div style={{color: '#ffffff', fontWeight: '600'}}>{vitals.bp_systolic}/{vitals.bp_diastolic} mmHg</div>
                </div>
                <div>
                  <label style={{color: '#b8bcc8', fontSize: '12px'}}>Heart Rate</label>
                  <div style={{color: '#ffffff', fontWeight: '600'}}>{vitals.heart_rate} bpm</div>
                </div>
                <div>
                  <label style={{color: '#b8bcc8', fontSize: '12px'}}>Temperature</label>
                  <div style={{color: '#ffffff', fontWeight: '600'}}>{vitals.temperature}¬∞C</div>
                </div>
                <div>
                  <label style={{color: '#b8bcc8', fontSize: '12px'}}>Weight</label>
                  <div style={{color: '#ffffff', fontWeight: '600'}}>{vitals.weight} kg</div>
                </div>
              </div>
            </div>
          )}

          {/* Eye Examination Section */}
          <div style={{display: 'grid', gridTemplateColumns: '1fr 1fr', gap: '20px', marginBottom: '20px'}}>
            <div style={{
              background: '#2a2d47',
              borderRadius: '8px',
              padding: '16px',
              border: '1px solid #3a3d5a'
            }}>
              <h4 style={{color: '#ffa057', margin: '0 0 12px 0'}}>Right Eye (OD)</h4>
              <div style={{display: 'grid', gap: '8px'}}>
                <div>
                  <label style={{color: '#b8bcc8', fontSize: '12px'}}>Visual Acuity</label>
                  <div style={{color: '#ffffff', fontWeight: '600'}}>{eyeData.rightEye.visualAcuity}</div>
                </div>
                <div>
                  <label style={{color: '#b8bcc8', fontSize: '12px'}}>Cornea</label>
                  <div style={{color: '#ffffff', fontWeight: '600'}}>{eyeData.rightEye.cornea}</div>
                </div>
              </div>
            </div>

            <div style={{
              background: '#2a2d47',
              borderRadius: '8px',
              padding: '16px',
              border: '1px solid #3a3d5a'
            }}>
              <h4 style={{color: '#ffa057', margin: '0 0 12px 0'}}>Left Eye (OS)</h4>
              <div style={{display: 'grid', gap: '8px'}}>
                <div>
                  <label style={{color: '#b8bcc8', fontSize: '12px'}}>Visual Acuity</label>
                  <div style={{color: '#ffffff', fontWeight: '600'}}>{eyeData.leftEye.visualAcuity}</div>
                </div>
                <div>
                  <label style={{color: '#b8bcc8', fontSize: '12px'}}>Cornea</label>
                  <div style={{color: '#ffffff', fontWeight: '600'}}>{eyeData.leftEye.cornea}</div>
                </div>
              </div>
            </div>
          </div>

          {/* Clinical Findings */}
          <div style={{
            background: '#2a2d47',
            borderRadius: '8px',
            padding: '16px',
            marginBottom: '20px',
            border: '1px solid #3a3d5a'
          }}>
            <h4 style={{color: '#ffa057', margin: '0 0 12px 0'}}>Clinical Findings</h4>
            <div style={{display: 'grid', gap: '12px'}}>
              <div>
                <label style={{color: '#b8bcc8', fontSize: '12px'}}>Diagnosis</label>
                <div style={{color: '#ffffff', fontWeight: '600', padding: '8px', background: '#1e1e2f', borderRadius: '4px'}}>
                  {consultation.diagnosis}
                </div>
              </div>
              <div>
                <label style={{color: '#b8bcc8', fontSize: '12px'}}>Prescription</label>
                <div style={{color: '#ffffff', fontWeight: '600', padding: '8px', background: '#1e1e2f', borderRadius: '4px'}}>
                  {consultation.prescription || 'No prescription given'}
                </div>
              </div>
              <div>
                <label style={{color: '#b8bcc8', fontSize: '12px'}}>Clinical Notes</label>
                <div style={{color: '#ffffff', fontWeight: '600', padding: '8px', background: '#1e1e2f', borderRadius: '4px'}}>
                  {consultation.notes || 'No additional notes'}
                </div>
              </div>
            </div>
          </div>

          {/* Billing Information */}
          <div style={{
            background: '#2a2d47',
            borderRadius: '8px',
            padding: '16px',
            border: '1px solid #3a3d5a'
          }}>
            <h4 style={{color: '#ffa057', margin: '0 0 12px 0'}}>Billing Information</h4>
            <div style={{display: 'grid', gridTemplateColumns: 'repeat(auto-fit, minmax(150px, 1fr))', gap: '12px'}}>
              <div>
                <label style={{color: '#b8bcc8', fontSize: '12px'}}>Consultation Fee</label>
                <div style={{color: '#ffffff', fontWeight: '600'}}>KSH {consultation.amount}</div>
              </div>
              <div>
                <label style={{color: '#b8bcc8', fontSize: '12px'}}>Date & Time</label>
                <div style={{color: '#ffffff', fontWeight: '600'}}>{new Date(consultation.created_at).toLocaleString()}</div>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default ReadOnlyConsultationView;
